import './movie.css'
import React, { useState, useEffect } from "react";
import "react-bootstrap-carousel/dist/react-bootstrap-carousel.css";

export function TestPage() {

    var genres = ['Action', 'Adventure', 'Animation', 'Comedy', 'Crime'];
    return (
        <div className="MoviePage d-flex align-items-center" style={{backgroundImage: "url('https://images.unsplash.com/photo-1509347528160-9a9e33742cdb?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80')"}}>
            <div className = "mx-5 d-flex flex-direction-row">
                <div className='d-flex flex-direction-column'>
                    {
                        genres.map((genre) => {
                            return (
                                <p className='transparentBox px-4 py-2 mr-3 text-white'>{genre}</p>
                            )
                        })
                    }
                </div>
                <h2>"The Shawshank Redemption"</h2>
            </div>
        </div>
    );
}
